  const [data, setData] = useState([
    {
      id: 1,
      title: " work :1",
    },
    {
      id: 2,
      title: " work :2",
    },
    {
      id: 2,
      title: " work :2",
    },
  ]);
  return (
    <Block>
      <div><input type="text" />
      <button>add property</button></div>
      <div>{data.map((value,id)=>
      <div key={id}>

      </div>
      )}</div>
    </Block>
  );
};

export default UseRaducer;
